def fibonacciSums(n):
    """"""
    (a, b) = (0, 1)
    total_sum = 0
    sum_squared = 0
    while b < n:
        (a, b) = (b, a + b)
        if b % 3 == 0 or b % 5 == 0:
            if b % 10 == 3 or b % 10 == 7:
                total_sum += b
                sum_squared += b ** 2
    return [total_sum, sum_squared]
